import React from 'react';
import {FaBars, FaTimes} from 'react-icons/fa';

const NavBar = () => {
//CAN WRITE JS HERE

const tags = [
  // created so that i can .map them into the navbar
  {

  link: 'home',
  },
  {

  link: 'about',
  },
  {
    id: 3,
  link: 'portfolio',
  },
  {
    id: 4,
  link: 'experience',
  },
  {
    id: 5,
  link: 'contact',
  }
] 

  return (
    <div className="flex justify-between items-center w-full h-20 px-4 text-emerald-400 bg-black fixed">
    <div>
        <h1 className='text-5xl font-myFont ml-2'>Williams</h1>
        </div>
      <ul className='flex'>

      {/* jsx code with the {} alowing mapping of the JS const tags */}
      {/* map through the id of the link */}
      {/* in order to map.. add a key.. the key is the link */}
      {tags.map(({link}) => (
        <li key={link} className='px-4 text-pink-400 cursor-pointer hover:scale-125 duration-500'>

        {link}

        </li>
      ))}

      </ul>
     </div>
  );
};

export default NavBar;
